import React from 'react';

const MessageList = ({ messages }) => {
    return (
        <div>
            <h2>Messages:</h2>
            <ul>
                {messages.map((msg, index) => (
                    <li key={index}>{`${msg.user}: ${msg.message}`}</li>
                ))}
            </ul>
        </div>
    );
};

export default MessageList;
